import React from "react";

export default function Tobbar({ subtitle }) {
  // <Tobbar subtitle="สวัสดีเราคือ Subtitle"></Tobbar>;
  return (
    <nav>
      <h1> {subtitle} </h1>
    </nav>
  );
}
